import React, {useState} from "react"
import './register.css'

export const  Phone = (props) => {
    const[phone, setPhone]  = useState('')
   

    const handleSubmit = (e) => {
        e.preventDefault();
            console.log(phone);
    }
    
    return (
       
         <div>
         <h2 className ="head-text">Enter Phone to recieve token</h2>
             <form className="login-form"  onSubmit={handleSubmit}>
           <label htmlFor="email">Email</label>
		   <input value={phone} onChange={(e) => setPhone(e.target.value)}  type="number" placeholder="your phone" id="phone" name="phone"></input>
		  
		   <button  className="send-btn"  type="submit">Send</button>
		 </form>
		<button className="link-btn" onClick={() =>  props.onFormSwitch("loginForm")}>Use Phone Instead</button>
         </div>
      
        
    )
}
export default Phone;
